struct Word: Identifiable {
  var id = UUID()
  var word: String = "     " // Keep this to 5 letters
  var correctWord: String
  var guessedCharacters: Set<Character>
  var letters: [Letter] = [Letter]()
  var characterStates: [String: LetterType] {
    get {
      var characterStates2: [String: LetterType] = [String: LetterType]()
      for letter in letters {
        characterStates2[letter.character] = letter.state
      }
      return characterStates2
    }
  }
  
  var isCorrect: Bool {
    get {
      word == correctWord ? true : false
  
    }
  }
  
  init(word: String? = nil, correctWord: String? = nil, guessedCharacters: Set<Character>? = nil) {
    if let word = word {
        self.word = word
    } else {
      self.word = "     "
    }
    if let correctWord = correctWord {
      self.correctWord = correctWord
    } else {
      self.correctWord = "     "
    }
    
    if let guessedCharacters = guessedCharacters {
      self.guessedCharacters = guessedCharacters
    } else {
      self.guessedCharacters = Set<Character>()
    }
    
    var wordArray = [" ", " ", " ", " ", " "]
    if let word = word {
      wordArray = word.map { String($0) }
    }
    var correctWordArray = [" ", " ", " ", " ", " "]
    if let correctWord = correctWord {
      correctWordArray = correctWord.map { String($0) }
    }
    
    for (index, letter) in wordArray.enumerated() {
      if correctWordArray[index] == wordArray[index] && letter != " " {
        letters.insert(Letter(character: letter, state: .correctPosition), at: index)
      } else if correctWordArray.contains(letter) && letter != " " {
        letters.insert(Letter(character: letter, state: .inWord), at: index)
      } else if !correctWordArray.contains(letter) && letter != " " {
        letters.insert(Letter(character: letter, state: .notInWord), at: index)
      } else {
        letters.insert(Letter(character: letter, state: .empty), at: index)
      }
    }
    
  }
  
  //Unused function since the word provides it's own letter states now
//  mutating func updateCorrectLetters(word: String, correctWord: String) {
//    let wordArray = word.map { String($0) }
//    let correctWordArray = correctWord.map { String($0) }
//    
//    letters.removeAll()
//    
//    for (index, letter) in wordArray.enumerated() {
//      if correctWordArray[index] == wordArray[index] && letter != " " {
//        letters.insert(Letter(character: letter, state: .correctPosition), at: index)
//      } else if correctWordArray.contains(letter) && letter != " " {
//        letters.insert(Letter(character: letter, state: .inWord), at: index)
//      } else if !correctWordArray.contains(letter) && letter != " " {
//        letters.insert(Letter(character: letter, state: .notInWord), at: index)
//      } else {
//        letters.insert(Letter(character: letter, state: .empty), at: index)
//      }
//    }
//    
//  }
  
  // Used to update letters as they are inputed. It will always return a LetterState of .empty.
  // To update with the corrent letter stat of the word you should use the function recalculateCorrectLetter
  mutating func updateLetters(word: String, correctWord: String) {
    let wordArray = word.map { String($0) }
    //let correctWordArray = correctWord.map { String($0) }
    
    letters.removeAll()
    
    for (index, letter) in wordArray.enumerated() {
        letters.insert(Letter(character: letter, state: .empty), at: index)
    }
    
  }
  
  mutating func replaceLetter(at: Int, with: String) {
    var wordArray = word.map { String($0) }
    wordArray[at] = with
    word = wordArray.joined(separator: "")
    updateLetters(word: word, correctWord: correctWord)
  }
  
}

struct Letter: Hashable {
  var character: String
  var state: LetterType
}

enum LetterType {
  case empty, notInWord, inWord, correctPosition
}

